import React , {Component} from 'react';
import './Navbar.css'

class Navbar extends Component{
    render(){
        return(
            <div className="navbar-div">
                <div className="navbar-content">
                    <h1>Patient Referral Form</h1>
                    <h2></h2>
                </div>
            </div>
        )
    }
}

export default Navbar
